import React, { Component } from 'react';
import city from './../imgs/interactive/City.svg';
import coral from './../imgs/interactive/Ground.svg';
import seaweed from './../imgs/interactive/Sea.svg';
import trees from './../imgs/interactive/a_Sun.svg';
import car from './../imgs/interactive/b_Cloud.svg';
import './../css/background.css';

class Background extends Component {
  render() {
    return (
      <div>
        <img className='sky' src={sky}/>
        <img className='sea' src={sea}/>
        <img className='ground' src={ground}/>
        <img className='sun' src={sun}/>
        <img className='cloud' src={cloud}/>
      </div>

    );
  }
}

export default Background;
